Creates a new timer.

The [callback] callback is invoked after the given [duration]
(a [Duration]) has passed. A negative duration is treated similar to
a duration of 0.

If the [duration] is statically known to be 0, consider using [run].

Frequently the [duration] is either a constant or computed as in the
following example (taking advantage of the multiplication operator of
the Duration class):

    const TIMEOUT = const Duration(seconds: 3);
    const ms = const Duration(milliseconds: 1);

    startTimeout([int milliseconds]) {
      var duration = milliseconds == null ? TIMEOUT : ms * milliseconds;
      return new Timer(duration, handleTimeout);
    }

*Deprecation warning*: this constructor used to take an [int] (the time
in milliseconds) and a callback with one argument (the timer). This has
changed to a [Duration] and a callback without arguments.

The web socket protocol is implemented by a HTTP or HTTPS server handler
which can be instantiated like this:

    WebSocketHandler wsHandler = new WebSocketHandler();

and then its onRequest method can be assigned to the HTTP server, e.g.

    server.defaultHandler = wsHandler.onRequest;

or

    server.addRequestHandler((req) => req.path == "/ws",
                             wsHandler.onRequest);

This handler strives to implement web sockets as specified by RFC6455.

Gets the segments of a Path. The segments are just the result of
splitting the path on any '/' characters, except that a '/' at the
beginning does not create an empty segment before it, and a '/' at
the end does not create an empty segment after it.

    new Path('/a/b/c/d').segments() == ['a', 'b', 'c', d'];
    new Path(' foo bar //../') == [' foo bar ', '', '..'];

Parser for MIME multipart types of data as described in RFC 2046
section 5.1.1. The data to parse is supplied through the [:update:]
method. As the data is parsed the following callbacks are called:

  [:partStart;
  [:headerReceived;
  [:headersComplete;
  [:partDataReceived;
  [:partEnd;
  [:error:]

Representation of a header value in the form:

  [:value; parameter1=value1; parameter2=value2:]

[HeaderValue] can be used to conveniently build and parse header
values on this form.

To build an [:Accepts:] header with the value

    text/plain; q=0.3, text/html

use code like this:

    HttpClientRequest request = ...;
    var v = new HeaderValue();
    v.value = "text/plain";
    v.parameters["q"] = "0.3"
    request.headers.add(HttpHeaders.ACCEPT, v);
    request.headers.add(HttpHeaders.ACCEPT, "text/html");

To parse the header values use the [:fromString:] constructor.

    HttpRequest request = ...;
    List<String> values = request.headers[HttpHeaders.ACCEPT];
    values.forEach((value) {
      HeaderValue v = new HeaderValue.fromString(value);
      // Use v.value and v.parameters
    });
